-- Name: TABLE feature_cvterm; Type: COMMENT; Schema: chado; Owner: drupaluser
COMMENT ON TABLE chado.feature_cvterm IS 'Associate a term from a cv with a feature, for example, GO annotation.';
-- Name: COLUMN feature_cvterm.pub_id; Type: COMMENT; Schema: chado; Owner: drupaluser
