CREATE FUNCTION chado.project_point_up(bigint, bigint, bigint, bigint) RETURNS bigint
    AS $_$SELECT
  CASE WHEN $4<0
   THEN $3-$1             -- rev strand
   ELSE $1-$2             -- fwd strand
  END AS p$_$;
