            FROM  featuregroup WHERE group_id IN (
                SELECT group_id FROM featuregroup
                WHERE (srcfeature_id = s OR srcfeature_id IS NULL)
                  AND fmin >= mins[i]
                  AND fmax <= maxs[i]
                  AND group_id IN (
                      SELECT group_id FROM groupoverlaps( mins[i], maxs[i] )
                      WHERE  srcfeature_id = s
                  )
            )
        LOOP
            RETURN NEXT f;
        END LOOP;
    END LOOP;
    RETURN;
END;
$_$;
ALTER FUNCTION frange.groupinside(bigint[], bigint[], character varying[]) OWNER TO drupaluser;
-- Name: groupinside(bigint, bigint, character varying); Type: FUNCTION; Schema: frange; Owner: drupaluser
CREATE FUNCTION frange.groupinside(bigint, bigint, character varying) RETURNS SETOF frange.featuregroup
    AS $_$
  SELECT *
  FROM groupoverlaps($1,$2,$3)
  WHERE fmin >= $1 AND fmax <= $2
$_$;
ALTER FUNCTION frange.groupinside(bigint, bigint, character varying) OWNER TO drupaluser;
-- Name: groupoverlaps(bigint, bigint); Type: FUNCTION; Schema: frange; Owner: drupaluser
CREATE FUNCTION frange.groupoverlaps(bigint, bigint) RETURNS SETOF frange.featuregroup
    AS $_$
  SELECT *
  FROM featuregroup
  WHERE is_root = 1
    AND boxquery($1, $2) <@ boxrange(fmin,fmax)
$_$;
ALTER FUNCTION frange.groupoverlaps(bigint, bigint) OWNER TO drupaluser;
-- Name: groupoverlaps(bigint[], bigint[], character varying[]); Type: FUNCTION; Schema: frange; Owner: drupaluser
CREATE FUNCTION frange.groupoverlaps(bigint[], bigint[], character varying[]) RETURNS SETOF frange.featuregroup
    LANGUAGE plpgsql
    AS $_$
DECLARE
    mins alias for $1;
    maxs alias for $2;
    srcs alias for $3;
    f featuregroup%ROWTYPE;
    i int;
    s int;
BEGIN
    i := 1;
    FOR i in array_lower( mins, 1 ) .. array_upper( mins, 1 ) LOOP
        SELECT INTO s feature_id FROM feature WHERE uniquename = srcs[i];
        FOR f IN
            SELECT *
            FROM  featuregroup WHERE group_id IN (
                SELECT group_id FROM featuregroup
                WHERE (srcfeature_id = s OR srcfeature_id IS NULL)
                  AND group_id IN (
                      SELECT group_id FROM groupoverlaps( mins[i], maxs[i] )
                      WHERE  srcfeature_id = s
                  )
            )
        LOOP
            RETURN NEXT f;
        END LOOP;
    END LOOP;
    RETURN;
END;
$_$;
ALTER FUNCTION frange.groupoverlaps(bigint[], bigint[], character varying[]) OWNER TO drupaluser;
-- Name: groupoverlaps(bigint, bigint, character varying); Type: FUNCTION; Schema: frange; Owner: drupaluser
CREATE FUNCTION frange.groupoverlaps(bigint, bigint, character varying) RETURNS SETOF frange.featuregroup
    AS $_$
  SELECT g2.*
  FROM  featuregroup g1,
        featuregroup g2
  WHERE g1.is_root = 1
    AND ( g1.srcfeature_id = g2.srcfeature_id OR g2.srcfeature_id IS NULL )
    AND g1.group_id = g2.group_id
    AND g1.srcfeature_id = (SELECT feature_id FROM feature WHERE uniquename = $3)
    AND boxquery($1, $2) <@ boxrange(g1.fmin,g2.fmax)
$_$;
