-- Name: featureset_meets; Type: VIEW; Schema: chado; Owner: drupaluser
CREATE VIEW chado.featureset_meets AS
 SELECT x.object_id AS subject_id,
    y.object_id
   FROM ((chado.feature_meets r
     JOIN chado.feature_relationship x ON ((r.subject_id = x.subject_id)))
     JOIN chado.feature_relationship y ON ((r.object_id = y.subject_id)));
ALTER TABLE chado.featureset_meets OWNER TO drupaluser;
-- Name: fnr_type; Type: VIEW; Schema: chado; Owner: drupaluser
CREATE VIEW chado.fnr_type AS
 SELECT f.feature_id,
    f.name,
    f.dbxref_id,
    c.name AS type,
    f.residues,
    f.seqlen,
    f.md5checksum,
    f.type_id,
    f.timeaccessioned,
    f.timelastmodified
   FROM (chado.feature f
     LEFT JOIN chado.analysisfeature af ON ((f.feature_id = af.feature_id))),
    chado.cvterm c
  WHERE ((f.type_id = c.cvterm_id) AND (af.feature_id IS NULL));
ALTER TABLE chado.fnr_type OWNER TO drupaluser;
-- Name: fp_key; Type: VIEW; Schema: chado; Owner: drupaluser
