COMMENT ON TABLE chado.phenstatement IS 'Phenotypes are things::text like "larval lethal".  Phenstatements are things::text like "dpp-1 is recessive larval lethal". So essentially phenstatement is a linking table expressing the relationship between genotype, environment, and phenotype.';
