-- Name: a_box; Type: VIEW; Schema: so; Owner: drupaluser
CREATE VIEW so.a_box AS
 SELECT feature.feature_id AS a_box_id,
    feature.feature_id,
    feature.dbxref_id,
    feature.organism_id,
    feature.name,
    feature.uniquename,
    feature.residues,
    feature.seqlen,
    feature.md5checksum,
    feature.type_id,
    feature.is_analysis,
    feature.is_obsolete,
    feature.timeaccessioned,
    feature.timelastmodified
   FROM (chado.feature
     JOIN chado.cvterm ON ((feature.type_id = cvterm.cvterm_id)))
  WHERE (((cvterm.name)::text = 'A_box_type_1'::text) OR ((cvterm.name)::text = 'A_box_type_2'::text) OR ((cvterm.name)::text = 'A_box'::text));
