-- Name: sequence_length_variation; Type: VIEW; Schema: so; Owner: drupaluser
CREATE VIEW so.sequence_length_variation AS
 SELECT feature.feature_id AS sequence_length_variation_id,
    feature.feature_id,
    feature.dbxref_id,
    feature.organism_id,
    feature.name,
    feature.uniquename,
    feature.residues,
    feature.seqlen,
    feature.md5checksum,
    feature.type_id,
    feature.is_analysis,
    feature.is_obsolete,
    feature.timeaccessioned,
    feature.timelastmodified
   FROM (chado.feature
     JOIN chado.cvterm ON ((feature.type_id = cvterm.cvterm_id)))
  WHERE (((cvterm.name)::text = 'simple_sequence_length_variation'::text) OR ((cvterm.name)::text = 'sequence_length_variation'::text));
ALTER TABLE so.sequence_length_variation OWNER TO drupaluser;
