    feature.feature_id,
    feature.dbxref_id,
    feature.organism_id,
    feature.name,
    feature.uniquename,
    feature.residues,
    feature.seqlen,
    feature.md5checksum,
    feature.type_id,
    feature.is_analysis,
    feature.is_obsolete,
    feature.timeaccessioned,
    feature.timelastmodified
   FROM (chado.feature
     JOIN chado.cvterm ON ((feature.type_id = cvterm.cvterm_id)))
  WHERE (((cvterm.name)::text = 'five_prime_UTR'::text) OR ((cvterm.name)::text = 'three_prime_UTR'::text) OR ((cvterm.name)::text = 'internal_UTR'::text) OR ((cvterm.name)::text = 'untranslated_region_polycistronic_mRNA'::text) OR ((cvterm.name)::text = 'UTR'::text));
ALTER TABLE so.utr OWNER TO drupaluser;
